    render(){
        return(
            <div>
                <div class="textbox">
                <input placeholder="내용" type="text" id="comment" ref={ref=>this.comment_E=ref}/><br/>
                <button>취소</button><button onClick={this.inputFocus}>등록</button>
                </div>
            </div>
        );
    }
}

export default Board;
